import { Link, useLocation, useNavigate } from "react-router-dom";
import { useContext } from "react";
import authContext from "../Context/notes/authContext";
import "./navbar.css";

const Navbar = () => {
  const location = useLocation();
  const navigate = useNavigate();

  const { user, logout } = useContext(authContext);
  const isLoggedIn = !!user;

  const handleLogout = () => {
    logout();
    navigate("/Login");
  };

  return (
    <nav className="navbar navbar-expand-lg custom-navbar sticky-top shadow-lg">
      <div className="container-fluid">
        {/* Brand */}
        <Link
          className="navbar-brand fw-bold fs-3 text-white d-flex align-items-center"
          to={isLoggedIn ? "/home" : "/Login"}
        >
          <i className="bi bi-journal-text me-2"></i> iNotebook
        </Link>

        {/* Toggler */}
        <button
          className="navbar-toggler border-0"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Links + Auth */}
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            {isLoggedIn && (
              <>
                <li className="nav-item">
                  <Link
                    className={`nav-link px-3 fw-semibold ${
                      location.pathname === "/home" ? "active-nav" : ""
                    }`}
                    to="/home"
                  >
                    Home
                  </Link>
                </li>
                <li className="nav-item">
                  <Link
                    className={`nav-link px-3 fw-semibold ${
                      location.pathname === "/about" ? "active-nav" : ""
                    }`}
                    to="/about"
                  >
                    About
                  </Link>
                </li>
              </>
            )}
          </ul>

          {/* Right side */}
          <div className="d-flex align-items-center">
            {!isLoggedIn ? (
              <>
                <Link
                  className="btn btn-outline-light rounded-pill mx-2 px-4 fw-semibold"
                  to="/Login"
                >
                  Login
                </Link>
                <Link
                  className="btn btn-warning rounded-pill mx-2 px-4 fw-semibold"
                  to="/Signup"
                >
                  Sign Up
                </Link>
              </>
            ) : (
              <div className="dropdown">
                <button
                  className="btn btn-outline-light dropdown-toggle d-flex align-items-center rounded-pill px-3"
                  type="button"
                  data-bs-toggle="dropdown"
                  aria-expanded="false"
                >
                  <img
                    src={
                      user?.avatar ||
                      "https://cdn-icons-png.flaticon.com/512/149/149071.png"
                    }
                    alt="profile"
                    className="rounded-circle me-2 border border-2 border-light"
                    width="35"
                    height="35"
                  />
                  <span className="fw-semibold">{user?.name || "User"}</span>
                </button>
                <ul className="dropdown-menu dropdown-menu-end shadow-lg">
                  <li className="px-3 py-2">
                    <strong>{user?.name || "User"}</strong>
                    <br />
                    <small className="text-muted">
                      {user?.email || "user@email.com"}
                    </small>
                  </li>
                  <li>
                    <hr className="dropdown-divider" />
                  </li>
                  <li>
                    <button
                      className="dropdown-item text-danger fw-semibold d-flex align-items-center"
                      onClick={handleLogout}
                    >
                      <i className="bi bi-box-arrow-right me-2"></i> Logout
                    </button>
                  </li>
                </ul>
              </div>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
